import React, { useState } from 'react';
import { View, Text, StyleSheet, Image, TouchableOpacity, Dimensions } from 'react-native';
import { useRouter } from 'expo-router';
import { LinearGradient } from 'expo-linear-gradient';
import Animated, { FadeIn, FadeInDown } from 'react-native-reanimated';
import { useTheme } from '@/context/ThemeContext';
import { useLanguage } from '@/context/LanguageContext';
import { LanguageSelector } from '@/components/LanguageSelector';
import { COLORS } from '@/constants/Colors';

const { width, height } = Dimensions.get('window');

export default function Welcome() {
  const router = useRouter();
  const { theme } = useTheme();
  const { t } = useLanguage();
  const [currentPage, setCurrentPage] = useState(0);
  const totalPages = 3;

  const onboardingData = [
    {
      title: t('welcome.title1'),
      description: t('welcome.description1'),
      image: 'https://chatgpt.com/backend-api/public_content/enc/eyJpZCI6Im1fNjgzMmVhZDliYzQ0ODE5MWFjMjZkZjJlY2I4MzA4NDg6ZmlsZV8wMDAwMDAwMGEwNDA2MWY4OWIxMzQ1NjM3OWNlYmQyZSIsInRzIjoiNDg1NjAyIiwicCI6InB5aSIsInNpZyI6IjA0ODVlNzFmZjU2ODFhYWExZTRhMTBiMjE4MzJmNTBmNTkzMGI0NjM2NzliYmRmNTRmOTc5OWU3MDIxNzMyYWIiLCJ2IjoiMCIsImdpem1vX2lkIjpudWxsfQ=='
    },
    {
      title: t('welcome.title2'),
      description: t('welcome.description2'),
      image: 'data:image/jpeg;base64,'
    },
    {
      title: t('welcome.title3'),
      description: t('welcome.description3'),
      image: 'https://images.pexels.com/photos/4021779/pexels-photo-4021779.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2'
    }
  ];

  const nextPage = () => {
    if (currentPage < totalPages - 1) {
      setCurrentPage(currentPage + 1);
    } else {
      router.replace('/(tabs)');
    }
  };

  const skipToMain = () => {
    router.replace('/(tabs)');
  };

  const isDark = theme === 'dark';
  const currentData = onboardingData[currentPage];

  return (
    <View style={[styles.container, { backgroundColor: isDark ? '#1A1A1A' : COLORS.background }]}>
      <View style={styles.languageContainer}>
        <LanguageSelector compact />
      </View>
      
      <Animated.View 
        entering={FadeIn.duration(800)} 
        style={styles.imageContainer}
      >
        <Image
          source={{ uri: currentData.image }}
          style={styles.image}
          resizeMode="cover"
        />
        <LinearGradient
          colors={['transparent', isDark ? '#1A1A1A' : COLORS.background]}
          style={styles.gradient}
        />
      </Animated.View>

      <Animated.View 
        entering={FadeInDown.duration(800).delay(300)} 
        style={styles.contentContainer}
      >
        <Text style={[styles.title, { color: isDark ? COLORS.accent : COLORS.primary }]}>
          {currentData.title}
        </Text>
        <Text style={[styles.description, { color: isDark ? '#EFEFEF' : COLORS.text }]}>
          {currentData.description}
        </Text>

        <View style={styles.paginationContainer}>
          {Array(totalPages).fill(0).map((_, index) => (
            <View 
              key={index} 
              style={[
                styles.paginationDot, 
                { 
                  backgroundColor: currentPage === index 
                    ? (isDark ? COLORS.accent : COLORS.primary) 
                    : (isDark ? '#444' : '#D0D0D0') 
                }
              ]} 
            />
          ))}
        </View>

        <View style={styles.buttonContainer}>
          <TouchableOpacity onPress={skipToMain}>
            <Text style={[styles.skipButton, { color: isDark ? '#AFAFAF' : COLORS.secondary }]}>
              {t('welcome.skip')}
            </Text>
          </TouchableOpacity>
          
          <TouchableOpacity onPress={nextPage} style={styles.nextButton}>
            <LinearGradient
              colors={[COLORS.primary, COLORS.secondary]}
              start={{ x: 0, y: 0 }}
              end={{ x: 1, y: 1 }}
              style={styles.gradientButton}
            >
              <Text style={styles.nextButtonText}>
                {currentPage === totalPages - 1 ? t('welcome.getStarted') : t('welcome.next')}
              </Text>
            </LinearGradient>
          </TouchableOpacity>
        </View>
      </Animated.View>
    </View>
  );
}

